class Solution:
    def maxTotalReward(self, rewardValues: List[int]) -> int:
        rewardValues = list(sorted(set(rewardValues)))
        dp = 1
        for x in rewardValues:
            dp |= (dp & ((1 << x) - 1)) << x
            #print(f'x={x}, dp={dp}')
        j = 0
        ans = 0
        while (1 << j) < dp:
            if dp & (1 << j) != 0:
                ans = j
            j += 1
        return ans
